import React from "react";

const projects = [
  { id: 1, name: "Website Redesign", status: "In Progress", deadline: "2026-03-01" },
  { id: 2, name: "App UI", status: "Completed", deadline: "2026-02-10" },
  { id: 3, name: "Logo Design", status: "In Review", deadline: "2026-02-20" },
];

export default function Projects() {
  return (
    <div className="bg-white rounded shadow p-6">
      <div className="font-semibold text-lg mb-4">Projects</div>
      <div className="overflow-x-auto">
        <table className="min-w-full text-left">
          <thead>
            <tr>
              <th className="py-2 px-4 border-b">Project Name</th>
              <th className="py-2 px-4 border-b">Status</th>
              <th className="py-2 px-4 border-b">Deadline</th>
            </tr>
          </thead>
          <tbody>
            {projects.map((p) => (
              <tr key={p.id} className="hover:bg-gray-50">
                <td className="py-2 px-4 border-b">{p.name}</td>
                <td className="py-2 px-4 border-b">
                  <span className={`px-2 py-1 rounded text-xs font-semibold ${
                    p.status === "Completed"
                      ? "bg-green-100 text-green-700"
                      : p.status === "In Progress"
                      ? "bg-blue-100 text-blue-700"
                      : "bg-yellow-100 text-yellow-700"
                  }`}>
                    {p.status}
                  </span>
                </td>
                <td className="py-2 px-4 border-b">{p.deadline}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
